-- SET UP SCHEMA HERE
DROP DATABASE IF EXISTS header;
CREATE DATABASE IF NOT EXISTS header;

USE header;

-- ---------------------------------
-- Restaurant Table---------------------

CREATE TABLE IF NOT EXISTS Restaurant (
    id INT(11) NOT NULL,
    name VARCHAR(30) NULL,
    PRIMARY KEY (id)
);

-- ---------------------------------
-- Country Table---------------------

CREATE TABLE IF NOT EXISTS Country (
    id INT(11) NOT NULL,
    name VARCHAR(50) NULL,
    PRIMARY KEY (id)
);

-- ---------------------------------
-- Metro Table---------------------

CREATE TABLE IF NOT EXISTS Metro (
    id INT(11) NOT NULL,
    name VARCHAR(50) NULL,
    country_id INT NOT NULL,
    PRIMARY KEY (id)
);

ALTER TABLE Metro ADD FOREIGN KEY (country_id) REFERENCES Country (id);

-- ---------------------------------
-- Region Table---------------------

CREATE TABLE IF NOT EXISTS Region (
    id INT(11) NOT NULL,
    name VARCHAR(50) NULL,
    metro_id INT NOT NULL,
    PRIMARY KEY (id)
);

ALTER TABLE Region ADD FOREIGN KEY (metro_id) REFERENCES Metro (id);

-- ---------------------------------
-- Community Table---------------------

CREATE TABLE IF NOT EXISTS Community (
    id INT(11) NOT NULL,
    name VARCHAR(50) NULL,
    region_id INT NOT NULL,
    PRIMARY KEY (id)
);

ALTER TABLE Community ADD FOREIGN KEY (region_id) REFERENCES Region (id);

-- ---------------------------------
-- Images Table---------------------

CREATE TABLE IF NOT EXISTS Images (
    id int not null,
    url VARCHAR(200),
    restaurant_id INT NULL,
    PRIMARY KEY (id)
);

ALTER TABLE Images ADD FOREIGN KEY (restaurant_id) REFERENCES Restaurant (id);

